import { createApp } from 'vue';
import App from './App.vue';
import router from './router';
import store from './store';
import './assets/css/main.css';

// Font Awesome setup
import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/vue-fontawesome';
import { 
  faHome, faBook, faChartLine, faCog, faBell, faCamera, 
  faUpload, faEdit, faTrash, faSave, faFileExport, faSyncAlt,
  faCopy, faMagic, faQuestionCircle, faChevronDown, faPlus,
  faCheck, faCheckCircle, faFileAlt, faBullseye, faTimes,
  faSpinner, faRobot, faHighlighter
} from '@fortawesome/free-solid-svg-icons';
import { 
  faFacebookF, faGoogle, faApple 
} from '@fortawesome/free-brands-svg-icons';

// Add the icons you need
library.add(
  faHome, faBook, faChartLine, faCog, faBell, faCamera, 
  faUpload, faEdit, faTrash, faSave, faFileExport, faSyncAlt,
  faCopy, faMagic, faQuestionCircle, faChevronDown, faPlus,
  faCheck, faCheckCircle, faFileAlt, faBullseye, faTimes,
  faSpinner, faRobot, faHighlighter,
  faFacebookF, faGoogle, faApple
);

const app = createApp(App);

// Register the FontAwesomeIcon component globally
app.component('font-awesome-icon', FontAwesomeIcon);

// Global error handler
app.config.errorHandler = (err) => {
  console.error('Global error:', err);
  store.dispatch('setGlobalError', err.message || 'An unexpected error occurred');
};

app.use(router);
app.use(store);
app.mount('#app');
